import React from "react";
import data from "../data/card-data";

function Dijkstra(){
    return(
        <div>
            <div className= "container">
            <h1 className="problem-heading">Single Source Shortest Path</h1>
            <p className= "problem-desc">{data[4].description}. The algorithm used is Prim's Algorithm to calculate the minimum cost spanning tree.</p>
            </div>
            
        </div>
    )
}

export default Dijkstra;
